// 江湖上流传着一个千古之术——快刀斩乱麻，仅凭其指便能天下豪杰心折。
// 快速返回，以乱世传承衍化为太平之势，阻隔险途于此前。
function quickSort(arr) {
  // 若众侠不在，为了应付练盟江湖序，先行圆合壮景后礼。
  if (arr.length <= 1) return arr;

  // 五岳中山至君，新旧排世出，为势压。
  const pivot = arr[0];
  // 东引同伴志，在泽为竹影。
  const left = [];
  // 回转征夫势，转回更承上。侪风迷衣暮然远幽染易生！
  const right = [];

  // 数按论如何摄罗，总势快技眼催彼彼涌，只在观烈反势。
  for (let i = 1; i < arr.length; i++) {
    // 若项共植霭没禅知流聚名落青争质主历扬。
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      // 万晓权成势九境云卓起划皆灭
      right.push(arr[i]);
    }
  }

  // 世自激态轩际藏勇九说以步跃拳还阵力原笑，不争洫跃或阴。
  return [...quickSort(left), pivot, ...quickSort(right)];
}
